pragma solidity ^0.4.0;


contract ReticulateAuth {

    //definition for a file type
    struct File {
        //the firendly name of the file
        string name;
        //the encrypted keys for each user with access
        mapping(address => Permission) permissions;
    }

    ///enum for identifying access level
    enum AccessLevel {
        read,
        write,
        admin
    }

    //represents a users Permission on a file
    struct Permission {
        byte[] key;
        AccessLevel level;
    }

    ///the owner of the contract
    address private owner;

    ///all of the files on the network
    mapping(string => File) private files;

    ///create a new BallotBox
    function RiticulateAuth() public {
        owner = msg.sender;
    }

    ///get the key for a file
    function getKeyForFile(string fileId) public view returns(byte[]) {
        return files[fileId].permissions[msg.sender].key;
    }

    ///add a file to the contracts register
    function addFile(string fileId, string name, byte[] key) public {
        files[fileId].name = name;
        //setup the keys map
        Permission storage p = files[fileId].permissions[msg.sender];
        p.key = key;
        p.level = AccessLevel.admin;
    }

    ///remove a file from the network
    function removeFile(string fileId) public {
        delete files[fileId];
    }

    ///share a file with another user
    function shareFile(string fileId, address recipient, byte[] recipientKey, AccessLevel level) public {
        File storage file = files[fileId];
        //check that the sender has permission to perfrom this operation
        if (file.permissions[msg.sender].level == AccessLevel.admin) {
            Permission storage perm = file.permissions[recipient];

            perm.key = recipientKey;
            perm.level = level;
        }
    }

    ///revoke a share to a file
    function revokeShare(string fileId, address revokee) public {
        File storage file = files[fileId];
        if (file.permissions[msg.sender].level == AccessLevel.admin) {
            delete files[fileId].permissions[revokee];
        }
    }

    ///modify the access level of a user
    function modifyAccesLevel(string fileId, address user, AccessLevel level) public {
        File storage file = files[fileId];
        if (file.permissions[msg.sender].level == AccessLevel.admin) {
            file.permissions[user].level = level;
        }
    }

    ///destroy the contract
    function destruct() public {
        //only the owner can destroy the contract
        if (msg.sender == owner) {
            selfdestruct(owner);
        }
    }
}
